My fourth or fifth time cutting my own hair now over the last four years and this time I'd let it grow out to my mid-back and was driving me crazy, but I wanted to have long hair, although after two years, it needed a trim. I hacked off more than anticipated in just five simple cuts and I stopped messing with it, as the more you cut, the less natural it looks unless you know what you're doing and I don't other than watching lots of YouTube and Instagram vids on medium men's hairstyles and most require a professional to do it using those techniques. So yes, I realize it looks less than professional, but in a few weeks it will come together a little more and I'm just excited to sleep without a huge mass of hair in the way or in an uncomfortable bun and although I wanted to still pull it back, I think it's too short to stay up without pins, so I'll just leave it down and just bun up the top portion for days I want to rock a #manbun lol 😂 might trim the sides and neck next if I feel it needs it... Next is my beard and getting my greys out... Lol 🤣
