What one piece of advice would you give to your 15 year old self?
Don't let your fears get in the way of enjoying your life.  People are basically good and everyone wants to be your friend.  Just let them in and do what you can to make their life as good as you can!

What was your greatest regret and how did you get through it?
My biggest regret is that I didn't pay attention to what I loved to do most, until later on in life.  I found that I am best at the things that I love to do.

What moment are you most proud of and why?
The moment I am most proud of is the moment I realized that the most important thing I can do in my life, is to leave people and places BETTER than the way that I found them.  Living my life in love like this, really feeds my soul. @laurieballa 

